// src/components/Pages/CreateAccount.js
import React, { useState } from 'react';
import './CreateAccount.css'; // Ensure you have this file created for the component-specific styles

const CreateAccount = () => {
  const [isLogin, setIsLogin] = useState(false);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [address, setAddress] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    if (isLogin) {
      // Handle login logic here
      console.log('Logging in with:', email, password);
    } else {
      // Handle create account logic here
      console.log('Creating account with:', name, email, password, phoneNumber, address);
    }
  };

  return (
    <div className="account-container">
      <h2>{isLogin ? 'Login' : 'Create Account'}</h2>
      <form onSubmit={handleSubmit}>
        {!isLogin && (
          <>
            <div className="form-group">
              <label>Name:</label>
              <input
                type="text"
                className="form-control"
                value={name}
                onChange={(e) => setName(e.target.value)}
                required
              />
            </div>
            <div className="form-group">
              <label>Phone Number:</label>
              <input
                type="text"
                className="form-control"
                value={phoneNumber}
                onChange={(e) => setPhoneNumber(e.target.value)}
                required
              />
            </div>
            <div className="form-group">
              <label>Address:</label>
              <input
                type="text"
                className="form-control"
                value={address}
                onChange={(e) => setAddress(e.target.value)}
                required
              />
            </div>
          </>
        )}
        <div className="form-group">
          <label>Email:</label>
          <input
            type="email"
            className="form-control"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Password:</label>
          <input
            type="password"
            className="form-control"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <button type="submit" className="btn btn-primary">{isLogin ? 'Login' : 'Create Account'}</button>
      </form>
      <button className="btn btn-secondary toggle-button" onClick={() => setIsLogin(!isLogin)}>
        {isLogin ? 'Create Account' : 'Already have an account? Login'}
      </button>
    </div>
  );
}

export default CreateAccount;
